import './App.css';


class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
        rowData: [
            {Itemname: "Milk", brandname: "Amul", quantity: "1ltr", price: 22.00},
            {Itemname: "Apples", brandname: "", quantity: "2kg", price: 200.00},
            {Itemname: "Onion", brandname: "", quantity: "1kg", price: 35.00}
            
        ]
    }
}

