            <Dropdown></Dropdown>
              
          </div>
          <div
              className="ag-theme-balham"
              style={{ height: '200px', width: '800px' }}
          >
              

              <Tabs></Tabs>
          </div>
          </div>
      );
  }
}


export default App;
